import React, { useEffect, useState } from "react";
import axios from "axios";
import {
  Box,
  Typography,
  Grid,
  CircularProgress,
  Paper,
  Divider,
} from "@mui/material";
import CheckIcon from "@mui/icons-material/Check";

const ComparePage = () => {
  const [car1, setCar1] = useState(null);
  const [car2, setCar2] = useState(null);
  const [loading, setLoading] = useState(true);

  const user = JSON.parse(sessionStorage.getItem("user"));
  const userId = user?.id;

  useEffect(() => {
    if (!userId) return;
    axios
      .get(`http://localhost:3030/api/comparison/${userId}`)
      .then((res) => {
        const dto = res.data;
        setCar1(dto.car2); // car2 solda gösterilecek
        setCar2(dto.car1); // car1 sağda gösterilecek
      })
      .catch((err) => {
        console.error("Karşılaştırma verisi alınamadı:", err);
      })
      .finally(() => setLoading(false));
  }, [userId]);

  const isNumeric = (val) => !isNaN(parseFloat(val)) && isFinite(val);

  const renderFeatureRow = (label, key) => {
    const val1 = car1?.[key];
    const val2 = car2?.[key];
    const isEqual = val1 === val2;

    const compare = () => {
      if (!isNumeric(val1) || !isNumeric(val2)) return [false, false];
      const num1 = parseFloat(val1);
      const num2 = parseFloat(val2);
      if (key === "price" || key === "km") {
        return [num1 < num2, num2 < num1];
      } else {
        return [num1 > num2, num2 > num1];
      }
    };

    const [better1, better2] = compare();

    const style = (highlight) => ({
      fontWeight: highlight ? "bold" : "normal",
      color: highlight ? "green" : "inherit",
      textAlign: "center",
    });

    return (
      <Grid container spacing={2} alignItems="center" key={key} sx={{ py: 1 }}>
        <Grid item xs={4}>
          <Typography sx={style(better1)} textAlign="center">
            {val1}
          </Typography>
        </Grid>
        <Grid item xs={4} textAlign="center">
          <Typography color="text.secondary">{label}</Typography>
          {isEqual && <CheckIcon sx={{ color: "green", ml: 1 }} />}
        </Grid>
        <Grid item xs={4}>
          <Typography sx={style(better2)} textAlign="center">
            {val2}
          </Typography>
        </Grid>
      </Grid>
    );
  };

  if (loading) return <CircularProgress sx={{ m: 5 }} />;
  if (!car1 || !car2)
    return <Typography m={5}>Karşılaştırma bulunamadı.</Typography>;

  return (
    <Box p={4}>
      <Typography variant="h4" gutterBottom textAlign="center">
        🚗 Araç Karşılaştırması
      </Typography>

      {/* Arabalar Aynı Satırda */}
      <Grid
        container
        spacing={2}
        alignItems="center"
        justifyContent="center"
        sx={{ mb: 4 }}
      >
        <Grid item xs={5}>
          <Paper elevation={3}>
            {car1.images?.[0] && (
              <Box
                component="img"
                src={`data:image/jpeg;base64,${car1.images[0].imageBase64}`}
                alt={`${car1.brand} ${car1.model}`}
                sx={{
                  width: "100%",
                  aspectRatio: "16/9",
                  objectFit: "cover",
                }}
              />
            )}
            <Box p={2} textAlign="center">
              <Typography variant="h6">
                {car1.brand} {car1.model}
              </Typography>
              <Typography variant="body2" color="text.secondary">
                {car1.fuel}
              </Typography>
            </Box>
          </Paper>
        </Grid>

        <Grid
          item
          xs={2}
          display="flex"
          justifyContent="center"
          alignItems="center"
        >
          <Typography fontWeight="bold">Karşılaştırma</Typography>
        </Grid>

        <Grid item xs={5}>
          <Paper elevation={3}>
            {car2.images?.[0] && (
              <Box
                component="img"
                src={`data:image/jpeg;base64,${car2.images[0].imageBase64}`}
                alt={`${car2.brand} ${car2.model}`}
                sx={{
                  width: "100%",
                  aspectRatio: "16/9",
                  objectFit: "cover",
                }}
              />
            )}
            <Box p={2} textAlign="center">
              <Typography variant="h6">
                {car2.brand} {car2.model}
              </Typography>
              <Typography variant="body2" color="text.secondary">
                {car2.fuel}
              </Typography>
            </Box>
          </Paper>
        </Grid>
      </Grid>

      {/* Özellik Karşılaştırmaları */}
      <Paper elevation={2} sx={{ p: 3 }}>
        {renderFeatureRow("Fiyat (₺)", "price")}
        <Divider sx={{ my: 1 }} />
        {renderFeatureRow("Kilometre", "km")}
        <Divider sx={{ my: 1 }} />
        {renderFeatureRow("Model Yılı", "year")}
        <Divider sx={{ my: 1 }} />
        {renderFeatureRow("Yakıt Türü", "fuel")}
        <Divider sx={{ my: 1 }} />
        {renderFeatureRow("İletişim", "contact")}
      </Paper>
    </Box>
  );
};

export default ComparePage;
